import React from "react";
import Cards from "./Cards";
import Sdata from "./Sdata";

function App(){
    return(
        <>
            <div className="container">
                <h1>Featured Products</h1>
                <Cards imgsrc="https://www.pathakh.com/images/visiting-card.jpg" 
                category="Printing" 
                title="Business Card" 
                link="https://www.pathakh.com/visiting-card.html" />
                <Cards imgsrc="https://www.pathakh.com/images/letter-head.jpg" 
                category="Printing" 
                title="Letterhead" 
                link="https://www.pathakh.com/visiting-card.html" />
                <Cards imgsrc="https://www.pathakh.com/images/id-card-printing-delhi.jpg" 
                category="Printing" 
                title="ID Card" 
                link="https://www.pathakh.com/visiting-card.html" />
            </div>
        </>
    );
}   

export default App;
